import React, { useState } from 'react';

import 'bulma/css/bulma.css'
import axios from 'axios' 
let _list = ""

const List = () =>{
    const [participants, pdata] = useState([]);
        axios.get('https://xo3dnghur7.execute-api.us-east-2.amazonaws.com/dev/registration_app_get_check_in_details?event_id=testkonfhubslsdeploymentb29912c5')
        .then(function (response) {
          // handle success
           console.log(response.data);
           _list = response.data;

        })
        .catch(function (error) {
          // handle error
          console.log(error);
        })
        .finally(function () {
            pdata(_list) 
        });

    return(
        <div className="list is-hoverable">
        {
            participants.map(e => {
               return(
                <a className="list-item">
                <p>Name:{e.name}</p><br/><p>Email-id:{e.email_id}</p>
                </a>
               )
            })
        }
       </div>
    )
}


export default List
